import React from 'react';
import { Link } from 'react-router-dom';

function Homepage() {
  return (
    <div className="container">
      <header>
        <h1>Welcome to the Quiz Application</h1>
      </header>
      <section className="about">
        <h2>About</h2>
        <p>This is an interactive quiz application that supports multiple languages. Attempt the quiz, check your score, and explore your profile!</p>
      </section>
      <section>
        <Link to="/quiz">
          <button>Attempt Quiz</button>
        </Link>
      </section>
      <section>
        <Link to="/profile">
          <button>Profile Section</button>
        </Link>
      </section>
    </div>
  );
}

export default Homepage;
